const MyHistory=()=>
{
return(
  <React.Fragment>
<nav id="campus2">
  	                
<div class="campus">

   <h1>University Campus</h1><br/>

</div>

 <div class="campus1">


         <div>
         <h5> <a  href="#" target="_blank" onClick={this.StudentList}>StateBoard</a></h5> 

         </div>
          
          
          <h5>Matriculation</h5>
         
          <h5>CBSC</h5>

          <h5>Primary</h5>
      

 </div>

</nav>	</React.Fragment>
)}
StudentList()
var studentData = [
  {name: "Thomas Mak", score: 86},
